import styles from "./ModuleBlock.module.scss";

export interface ModuleInterface {
  name: string;
  content: string[];
}

const Module = ({ module }: { module: ModuleInterface }) => {
  return (
    <div className={styles.moduleContainer}>
      <header className={styles.moduleHeader}>{module.name}</header>
    </div>
  );
};

export default function ModuleBlock() {
  const modules = [
    { name: "1주차", content: ["Lecture note 1", "Lecture note 1"] },
    { name: "2주차", content: ["Lecture note 3", "Lecture note 4"] },
  ];
  return (
    <div className={styles.wrapper}>
      {modules.map((module) => (
        <Module module={module} />
      ))}
    </div>
  );
}
